// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./interfaces/IInstantWallet.sol";
import "./access/Ownable.sol";

contract InstantWallet is IInstantWallet, Ownable {
    Transaction[] Transactions;

    mapping(address => wallets) walletslist;
    
    event Transfer(address _from, uint256 _amount);

    
    address Factory;

    constructor(){
        Factory = msg.sender;
    }

    /**
     * @dev Initializes the InstantWallet contract with the provided parameters.
     * @param _walletlist The list of wallet addresses to be whitelisted.
     * @param _percent The corresponding percentages for each wallet address.
     * @param _name The name of the wallet.
     * @param _owner The address of the owner of the wallet.
     */
    function Initialize(
        address[] memory _walletlist,
        uint256[] memory _percent,
        string memory _name,
        address _owner
    ) external {
        require(msg.sender == Factory, "FORBIDDEN CALL");
        setOwner(_owner);
        whitelist[owner()] = true;
        for (uint256 index = 0; index < _walletlist.length; index++) {
            whitelist[_walletlist[index]] = true;
        }
        walletslist[owner()] = wallets(_name, _walletlist, _percent, false, 0);
    }

    function getWallet()
        public
        view
        onlyShares
        returns (wallets memory _wallets)
    {
        return walletslist[owner()];
    }

    function getTransactionsCount() public view returns (uint256 _count) {
        return Transactions.length;
    }

    function getTransactions()
        public
        view
        returns (Transaction[] memory _transactions)
    {
        return Transactions;
    }

    function stop() public onlyOwner {
        wallets memory cwallet = walletslist[owner()];
        cwallet._status = true;
        walletslist[owner()] = cwallet;
    }

    function start() public onlyOwner {
        wallets memory cwallet = walletslist[owner()];
        cwallet._status = false;
        walletslist[owner()] = cwallet;
    }

    function getStopStatus() public view returns (bool _stop) {
        return walletslist[owner()]._status;
    }

    receive() external payable {
        uint256 amount = msg.value;
        bool _stoped = walletslist[owner()]._status;
        address _sender = msg.sender;
        wallets memory cwallet = walletslist[owner()];
        cwallet._total += amount;

        Transactions.push(Transaction(_sender, address(this), "IN", amount));
        walletslist[owner()] = cwallet;

        //Check if contract stop then all amount sent to owner;
        if (!_stoped) {
            for (
                uint256 index = 0;
                index < walletslist[owner()]._list.length;
                index++
            ) {
                payable(walletslist[owner()]._list[index]).transfer(
                    (amount * walletslist[owner()]._percent[index]) / 100
                );

                Transactions.push(
                    Transaction(
                        address(this),
                        walletslist[owner()]._list[index],
                        "OUT",
                        (amount * walletslist[owner()]._percent[index]) / 100
                    )
                );
            }
            emit Transfer(_sender, amount);
        } else {
            payable(owner()).transfer(amount);
            Transactions.push(
                Transaction(address(this), owner(), "OUT", amount)
            );
        }
    }
}

